import React, { useState } from 'react';
import { Document, Page, Text, View, StyleSheet, PDFDownloadLink, Image} from '@react-pdf/renderer';
import { Button } from './components/ui/button';
import { Input } from './components/ui/input';
import { Textarea } from './components/ui/textarea';
import { Card, CardHeader, CardTitle, CardContent } from './components/ui/card';
import { FileText, Download } from 'lucide-react';

// Styles for PDF Quote
const styles = StyleSheet.create({
  page: { 
    padding: 30,
    backgroundColor: '#ffffff',
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 20,
  },
  logo: {
    width: 80,
    height: 80,
  },
  title: { 
    fontSize: 24, 
    fontWeight: 'bold',
    color: '#3b82f6', // Blue color
  },
  section: { 
    margin: 10, 
    padding: 10,
    backgroundColor: '#f3f4f6', // Light gray background
    borderRadius: 5,
  },
  sectionTitle: {
    fontSize: 14,
    fontWeight: 'bold',
    marginBottom: 5,
    color: '#1f2937', // Dark gray color
  },
  text: { 
    fontSize: 12, 
    marginBottom: 5,
    color: '#4b5563', // Medium gray color
  },
  totalSection: {
    marginTop: 20,
    borderTop: 1,
    borderColor: '#d1d5db',
    paddingTop: 10,
  },
  totalText: {
    fontSize: 14,
    fontWeight: 'bold',
    color: '#1f2937',
  },
  footer: {
    position: 'absolute',
    bottom: 30,
    left: 30,
    right: 30,
    textAlign: 'center',
    color: '#9ca3af',
    fontSize: 10,
  },
});

// PDF Document component
const QuotePDF = ({ quote }) => (
  <Document>
    <Page size="A4" style={styles.page}>
      <View style={styles.header}>
        <Image 
          style={styles.logo}
          // Path to logo file
          src="C:\Users\Tembo\OneDrive - towerbridge.tech\Projects\towerbridgetech\logo\Hires Jpeg-01.jpg" 
        />
        <View>
          <Text style={styles.title}>IT Support Invoice</Text>
          <Text style={styles.text}>Invoice #: INV-{Date.now()}</Text>
          <Text style={styles.text}>Date: {new Date().toLocaleDateString()}</Text>
        </View>
      </View>

      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Client Information</Text>
        <Text style={styles.text}>Name: {quote.name}</Text>
        <Text style={styles.text}>Email: {quote.email}</Text>
        <Text style={styles.text}>Phone: {quote.phone}</Text>
      </View>

      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Service Details</Text>
        <Text style={styles.text}>Issue Description: {quote.description}</Text>
        <Text style={styles.text}>Estimated Hours: {quote.hours}</Text>
        <Text style={styles.text}>Hourly Rate: ${quote.rate}</Text>
      </View>

      <View style={styles.totalSection}>
        <Text style={styles.totalText}>Total Cost: ${quote.total}</Text>
      </View>

      <View style={styles.footer}>
        <Text>Thank you for your business!</Text>
        <Text>Quoteless.ai - Your IT Support Partner</Text>
      </View>
    </Page>
  </Document>
);

const QuotelessFrontend = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    description: ''
  });
  const [quote, setQuote] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const generateQuote = (description) => {
    const rate = 75;
    const hours = Math.ceil(Math.random() * 5) + 1; // Random hours between 1-6
    return {
      description,
      hours,
      rate,
      total: hours * rate
    };
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const generatedQuote = generateQuote(formData.description);
    setQuote(generatedQuote);
  };

  return (
    <div className="max-w-2xl mx-auto mt-10 p-6 bg-white rounded-lg shadow-xl">
      <h1 className="text-2xl font-bold mb-6">Quoteless.ai - IT Support Quote</h1>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label htmlFor="name" className="block text-sm font-medium text-gray-700">Your Name</label>
          <Input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleInputChange}
            required
            placeholder="John Doe"
            className="mt-1"
          />
        </div>
        <div>
          <label htmlFor="email" className="block text-sm font-medium text-gray-700">Email Address</label>
          <Input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleInputChange}
            required
            placeholder="john@example.com"
            className="mt-1"
          />
        </div>
        <div>
          <label htmlFor="phone" className="block text-sm font-medium text-gray-700">Phone Number</label>
          <Input
            type="tel"
            id="phone"
            name="phone"
            value={formData.phone}
            onChange={handleInputChange}
            required
            placeholder="(123) 456-7890"
            className="mt-1"
          />
        </div>
        <div>
          <label htmlFor="description" className="block text-sm font-medium text-gray-700">Describe your IT issue in detail</label>
          <Textarea
            id="description"
            name="description"
            value={formData.description}
            onChange={handleInputChange}
            required
            placeholder="Please provide as much detail as possible about your IT issue..."
            rows={4}
            className="mt-1"
          />
        </div>
        <Button type="submit" className="w-full">Generate Quote</Button>
      </form>
      
      {quote && (
        <Card className="mt-6">
          <CardHeader>
            <CardTitle>Generated Quote</CardTitle>
          </CardHeader>
          <CardContent>
            <p>Issue Description: {quote.description}</p>
            <p>Estimated Hours: {quote.hours}</p>
            <p>Hourly Rate: ${quote.rate}</p>
            <p>Total Cost: ${quote.total}</p>
            <PDFDownloadLink
              document={<QuotePDF quote={quote} />}
              fileName="it_support_quote.pdf"
              className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 mt-4"
            >
              {({ blob, url, loading, error }) =>
                loading ? 'Generating PDF...' : 'Download PDF Quote'
              }
            </PDFDownloadLink>
          </CardContent>
        </Card>
      )}
    </div>
  );
};

export default QuotelessFrontend;
